import "./style.css";
import { useEffect } from "react"

import Snackbar from "@mui/material/Snackbar"
import Alert from '@mui/material/Alert';

import useUser from "../../hooks/useUser";

import Sidebar from "../../components/Sidebar";
import Header from "../../components/CmptsHeader/Header";
import MenuList from '../../components/Lists/MenuList';
import ClientsListItems from '../../components/Lists/ClientsListItems';
import ModalCreateClients from "../../components/Modals/ModalCreateClient";
import ModalCreateDebt from "../../components/Modals/ModalCreateDebt";

function Clients() {
  const { setOpenSnackbar, openModalClient, openSnackbar, openModalCreateDebt, setTitle, setIsActive } = useUser()

  useEffect(() => {
    setTitle("Clientes")
    setIsActive("clients");
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [])

  const handleCloseSnackbar = (event, reason) => {
    if (reason === 'clickaway') {

      return;
    }

    setOpenSnackbar(false);
  };

  return (
    <article className="ContainerClients">
      <Sidebar />
      <main className="ContentClients">
        <Header title='Clients' />
        <article className="Clients">
          <section className="ClientsContainer">
            <MenuList />
            <ClientsListItems />
          </section>
          <Snackbar
            open={openSnackbar}
            autoHideDuration={1000}
            onClose={handleCloseSnackbar}
            anchorOrigin={{ vertical: "bottom", horizontal: "right" }}
          >
            <Alert severity="info">Cadastro concluído com sucesso!</Alert>
          </Snackbar>
        </article>
        {openModalClient &&
          <ModalCreateClients />
        }
        {openModalCreateDebt &&
          <ModalCreateDebt />
        }
      </main>
    </article>
  );
}

export default Clients;
